const filterData = (id_area) => {
  return t.filter((x) => x.id_area === id_area);
};

const tFilter = (id_area, id_indikator) => {
  const firstFitler = subIndikatorList.filter((x) => x.id_area === id_area);

  const newData = [];
  firstFitler[0].detail.map((z) => {
    z.id_indikator === id_indikator ? newData.push(z.sub_indikator) : 0;
  });

  return newData ? newData : [];
};

