function findSubIndikatorById(id) {
  for (const area of subIndikatorList) {
    for (const indikator of area.detail) {
      const found = indikator.sub_indikator.find((sub) => sub.id === id);
      if (found) {
        return found;
      }
    }
  }
  return null;
}

